import React from "react";
import InstagramIcon from "@material-ui/icons/Instagram";
import EmailIcon from "@material-ui/icons/Email";
import GithubIcon from "@material-ui/icons/GitHub";
import "../styles/Home.css";

function Home() {
  return (
    <div className="home">
      <div className="about">
        <h2 style={{ color: 'pink'}}> Hello, I am Arabella Morgado!</h2>
        <div className="prompt">
          <p>A Computer Science Student.</p>
          <a href="https://www.instagram.com/arabeeeels?igsh=MWcxcWxnaG55aDJ1eQ==">
            <InstagramIcon />
          </a>
          <a href="https://github.com/j-bull2003">
            <GithubIcon />
          </a>
        </div>
      </div>
      <div className="skills">
        <h1> Experience </h1>
        <ol className="list">
          <li className="item">
            <h2> On-the-Job-Training</h2>
            <span>
              @Tricom Dynamics Inc.
              Technical Support Department
            </span>
          </li>
        </ol>
      </div>
    </div>
  );
}

export default Home;
